def pseudo_random_string(length):
    characters = 'abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789'
    result = ''
    seed = hash(str(length)) % 1000
    for i in range(length):
        index = (hash(str(seed + i)) % len(characters))
        result += characters[index]
        seed = (seed * 31 + i) % 1000
    return result

def random_uid():
    lengths = [8, 4, 4, 4, 8]
    parts = [pseudo_random_string(length) for length in lengths]
    return '-'.join(parts)

def random_email():
    return f"{pseudo_random_string(8)}@{pseudo_random_string(10)}.com"

def random_person():
    return {
        'uid': random_uid(),
        'email': random_email(),
        'firstname': pseudo_random_string(5),
        'lastname': pseudo_random_string(12),
        'password': pseudo_random_string(10)
    }

return [{'json': random_person()} for _ in range(100)]
